import styled from "styled-components";
import { ComponentHeaderAuth, ComponentUserDetail } from "@components";

export const PageUserDetail = () => {
    return (
        <ComponentHeaderAuth>
            <StyledUserDetailPage>
                <ComponentUserDetail />
            </StyledUserDetailPage>
        </ComponentHeaderAuth>
    );
};

const StyledUserDetailPage = styled.div`
    width: 100%;
    position: relative;
    top: -85px;
`;
